import * as React from "react";

class Heading extends React.Component {
    render() {
        return (
            <head>
                    <meta charset="UTF-8" />
                    <meta name="description" content="CSV validator" />
                    <meta name="keywords" content="csv, comma, separated, values, validator, bertolottipf" />
                    <meta name="author" content="BERTOLOTTI Paolo Francesco" />
                    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
                    <meta name="robots" content="index" />

                    <title>CSV validator</title>

                    {/* <link rel="stylesheet" href="/scripts/bootstrap-5.2.3-dist/css/bootstrap.min.css" />
                    <link rel="stylesheet" href="/styles/style.css" /> */}


                    <link rel="stylesheet" href="/scripts/bootstrap-5.2.3-dist/css/bootstrap.min.css" />
                    <link rel="stylesheet" href="/styles/style.css"/>
                    <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/bootstrap-icons@1.9.1/font/bootstrap-icons.css"/>
            </head>
        );
    }
}

export default Heading;
